В веб индустрии с 2016 года, этот опыт способствует качественному выполнению заданий любой сложности:
1. Дизайн современных сайтов;
2. Дизайн продающих банеров;
3. Дизайн логотипов;
4. Верстка: валидная, адаптивная, верстка мобильной версии сайта;
5. Создание сайтов: landing-page, landing-shop, визитки, корпоративные сайты, интернет-магазины и многое другое;
6. Продвижение сайтов, контекстная реклама ЯндексДирект;
7. Сопровождение сайта, техническая поддержка сайтов 24/7.

